import React from "react";
import CardLarge from "./CardLarge";

const CardLg = () => {
  return (
    <div class="content card-section-lg">
      <div class="card-discription">
        <p class="note">여긴 또 뭐라고 써야되나</p>
        <h3 class="sub-title">여기에 머라고 쓰나</h3>
      </div>
      <div class="card-box card-grid">
        <div class="card-collapse card-location">
          <div class="collapse-txt">
            <div class="txt-radius">
              <p>지도를 통한 검색 기능</p>
            </div>
            <div class="card-sub-title">
              <p>집 근처 빵 맛집을</p>
              <p>찾아낼래</p>
            </div>
            <div class="card-note">
              <p>지도 위 마커를 따라가면? 나만의 빵 맛집 발견!</p>
              <p>집 주변 나만의 인생빵집을 찾아보세요.</p>
            </div>
          </div>
          <div class="collapse-img">
            <img
              style={{ display: "flex" }}
              src="./img/LOCATION.png"
            />
          </div>
        </div>
        {/* <div class="card-primary card-location">
          <div class="primary-txt">
            <h2 class="card-note">집 근처 빵맛집을 찾아낼래</h2>
          </div>
          <div class="primary-img">
            <img src="./img/LOCATION.png" alt="" />
          </div>
        </div> */}
        <div class="card-primary card-favor">
          <div class="primary-txt">
            <h2 class="card-note">내 입에 딱맞는 빵 어디없나?</h2>
          </div>
          <div class="primary-img">
            <img src="./img/FAVOR-sm.png" alt="" />
          </div>
        </div>
        <div class="card-primary card-mate">
          <div class="primary-txt">
            <h2 class="card-note">혼자 가던 빵축제도 이젠 함께!</h2>
          </div>
          <div class="primary-img">
            <img src="./img/MATE-sm.png" alt="" />
          </div>
        </div>
        <div class="card-primary card-mood">
          <div class="primary-txt">
            <h2 class="card-note">#베이커리 #분좋카 #MOOD</h2>
          </div>
          <div class="primary-img">
            <img src="./img/MOOD-sm.png" alt="" />
          </div>
        </div>
      </div>
    </div>
    // <div className="card-section-lg">
    //   <div className="card-box card-grid">
    //     <div className="card-collapse card-location">
    //       <div className="collapse-txt">
    //         <div className="txt-radius">
    //           <p>지도를 통한 검색 기능</p>
    //         </div>
    //         <div className="card-sub-title">
