    //       </div>
    //       <div className="collapse-img">
    //         <img
    //           style={{ display: "flex" }}
    //           src="/res/images/LOCATION.png"
    //         />
    //       </div>
    //     </div>
    //     <CardLarge
    //       subtitle="지도를 통한 검색 기능"
    //       title={"집 근처 빵 맛집을\n찾아낼래"}
    //       note={
    //         "지도 위 마커를 따라가면? 나만의 빵 맛집 발견!\n집 주변 나만의 인생빵집을 찾아보세요."
    //       }
    //       color="#ff8a65"
    //       img="/res/images/LOCATION.png"
    //       active
    //     />
    //     <CardLarge
    //       subtitle="지도를 통한 검색 기능"
    //       title={"집 근처 빵 맛집을\n찾아낼래"}
    //       note={
    //         "지도 위 마커를 따라가면? 나만의 빵 맛집 발견!\n집 주변 나만의 인생빵집을 찾아보세요."
    //       }
